import React, { useEffect, useState } from "react";

import ViewList from "./ViewList";
import { toast, ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const Lista = () => {
  return (
    <>
      <ViewList />,
      <ToastContainer />
    </>
  );
};

export default Lista;
